import React from 'react';
import './IconSuccess.css';
import { VscCheck } from 'react-icons/vsc';
import { TweenMax, Power3 } from 'gsap';


// Return Icon Success 
export default function ReturnIconSuccess() {

 React.useEffect(() => {
  TweenMax.from('.wrp-subicon-success', 1, { delay: 2, opacity: 0, y: 0, scale: 1, ease: Power3.easeIn });
 }, []);

 return (
  <div className='wrp-icon-success'>
   <div className='wrp-subicon-success'>
    <VscCheck size={'2.5em'} color='white' />
   </div>
  </div>
 );
};
